import React, {Component} from "react";
import "./pc.css";
import Header from "./Header/Header";
import background from "./img/background.png"

class PC extends Component{
    constructor(props){
        super(props)
    }
    render(){
        return(
            <div className="pc">
                <div className="back"><img src={background}/></div>
                <Header/>
            </div>
        )
    }
}

export default PC
